import "./assets/index.scss";
import Reservation from "./containers/Reservation/Reservation";

function App() {
	return (
		<div className="App">
			<Header />
			<HeroSection />
			<Prices />
			<Reservation />
			<Footer />
		</div>
	);
}

export default App;
